import './index.css';

// console.log(Sdata[1].sname);


ReactDOM.render(
   <>
      <h1 className="heading_style">List of Top 5 Netflix Series in 2021</h1>

      <Cards imgsrc={Sdata[0].imgsrc}
            title={Sdata[0].title}
            sname={Sdata[0].sname} 
            link={Sdata[0].link}
      />
