            title={Sdata[1].title}
            sname={Sdata[1].sname} 
            link={Sdata[1].link}
      />
      <Cards imgsrc={Sdata[2].imgsrc}
            title={Sdata[2].title}
            sname={Sdata[2].sname} 
            link={Sdata[2].link}
      />
