            title={Sdata[1].title}
            sname={Sdata[1].sname} 
            link={Sdata[1].link}
      />
      <Cards imgsrc={Sdata[0].imgsrc}
            title={Sdata[0].title}
            sname={Sdata[0].sname} 
            link={Sdata[0].link}
      />
         </>,document.getElementById('root'));


